import{u as r,c as a,p as i,e as l,m as e,a as t,ab as n,o as s}from"./chunks/framework.CUflZczI.js";const c=e("h1",{id:"support",tabindex:"-1"},[t("Support "),e("a",{class:"header-anchor",href:"#support","aria-label":'Permalink to "Support"'},"​")],-1),u={key:0},d=e("div",{class:"custom-block danger"},[e("p",{class:"custom-block-title"},[t("This page may be out out of date. "),e("a",{href:"https://docs.px4.io/main/en/contribute/support.html"},"See the latest version"),t(".")])],-1),h=[d],p=n('<p>This section shows how you can get help from the core dev team and the wider community.</p><h2 id="forums-and-chat" tabindex="-1">Forums and Chat <a class="header-anchor" href="#forums-and-chat" aria-label="Permalink to &quot;Forums and Chat&quot;">​</a></h2><p>The core development team and community are active on the following channels:</p><ul><li><a href="https://discuss.px4.io/" target="_blank" rel="noreferrer">PX4 Discuss Forum</a> - Post here first!</li><li><a href="https://discord.gg/dronecode" target="_blank" rel="noreferrer">PX4 Discord</a> - Post here if you don&#39;t get a response in discuss within a few days (include a link to your forum topic).</li></ul><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>The Discuss Forum is much preferred because it is indexed by search engines and serves as a common knowledge base.</p></div><h2 id="diagnosing-problems" tabindex="-1">Diagnosing Problems <a class="header-anchor" href="#diagnosing-problems" aria-label="Permalink to &quot;Diagnosing Problems&quot;">​</a></h2><p>If you are unsure what the problem is and you need help diagnosing</p><ul><li>Upload logs to <a href="https://logs.px4.io/" target="_blank" rel="noreferrer">Flight Log Review</a></li><li>Open a discussion on <a href="https://discuss.px4.io/c/flight-testing/" target="_blank" rel="noreferrer">PX4 Discuss</a> with a flight report and links to logs.</li><li>The dev team may prompt you to <a href="#issue-bug-reporting">raise an issue</a> if the problem is caused by a bug.</li></ul><h2 id="issue-bug-reporting" tabindex="-1">Issue &amp; Bug Reporting <a class="header-anchor" href="#issue-bug-reporting" aria-label="Permalink to &quot;Issue &amp; Bug Reporting&quot;">​</a></h2><ul><li>Upload logs to <a href="https://logs.px4.io/" target="_blank" rel="noreferrer">Flight Log Review</a></li><li><a href="https://github.com/PX4/PX4-Autopilot/issues" target="_blank" rel="noreferrer">Open a Github Issue</a>. This must include a flight report with as much detail as possible (enough for the issue to be reproduced) and links to your logs on Flight review.</li></ul><h2 id="weekly-dev-call" tabindex="-1">Weekly Dev Call <a class="header-anchor" href="#weekly-dev-call" aria-label="Permalink to &quot;Weekly Dev Call&quot;">​</a></h2><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>Developers are most welcome to attend the <a href="./../contribute/dev_call.html">weekly dev call</a> (and other <a href="./../#calendar-events">developer events</a>) to engage more deeply with the project.</p></div><p>The <a href="./../contribute/dev_call.html">Dev Call</a> is a weekly meeting attended by the PX4 dev team to discuss platform technical details, coordinate activities and perform in-depth analysis.</p><p>There is also space in the agenda to discuss pull requests, major impacting issues and Q&amp;A.</p>',14),v=JSON.parse('{"title":"Support","description":"","frontmatter":{},"headers":[],"relativePath":"en/contribute/support.md","filePath":"en/contribute/support.md"}'),m={name:"en/contribute/support.md"},k=Object.assign(m,{setup(g){const{site:o}=r();return(b,f)=>(s(),a("div",null,[c,i(o).title!=="PX4 Guide (main)"?(s(),a("div",u,h)):l("",!0),p]))}});export{v as __pageData,k as default};
